import React from "react";
import "./ProductCard.css";

function ProductCard(props) {
  const { title, image, description } = props;

  return (
    <div className="card fi mx-2 shadow-lg product-card">
      <img src={image} className="card-img-top fixx product-image" alt={title} />
      <div className="card-body product-content">
        <h5 className="card-title text-primary product-title">{title}</h5>
        <p className="card-text product-description">{description}</p>
        <a href="#" className="btn btn-outline-primary product-button">
          Read more
        </a>
      </div>
    </div>
  );
}

export default ProductCard;
